import React from 'react';
function Header(){
    return(
        <div class="header">
            <div class="inner_header">
                <div class="logo_container">
                <h1>MY<span class="logo_part">APP</span></h1>
            </div>

            <ul class="navigation">
                <a><li>Home</li></a>
                <a><li>About</li></a>
                <a><li>Portfolio</li></a>
                <a><li>Contact</li></a>
            </ul>
        </div>

     </div>
    )
}
export default Header;
